import React from 'react';
import './App.css';
import { makeStyles} from '@material-ui/core/styles';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import HomeIcon from '@material-ui/icons/Home';
import FormatListNumberedIcon from '@material-ui/icons/FormatListNumbered';
import TrendingUpIcon from '@material-ui/icons/TrendingUp';
import SettingsIcon from '@material-ui/icons/Settings';
import Header from './components/Header.js';

import { BrowserRouter as Router, Switch, Route} from 'react-router-dom';

const useStyles = makeStyles((theme) => {

})


function App() {
  const classes = useStyles();
  const [value, setValue] = React.useState('home');

  const handleChange = (event, newValue) => {
    if (onChange) {
      onChange(event, value);
    }

    if (onClick) {
      onClick(event);
    }
  };

  return (
    <div className="App">
      <Header />

      <Router>
        <footer>
        <BottomNavigation value={value} onChange={handleChange} className={classes.root}>
          <BottomNavigationAction label="Home" icon={<HomeIcon />} value="home"/>
          <BottomNavigationAction label="Me" icon={<FormatListNumberedIcon />} value="me"/>
          <BottomNavigationAction label="Progress" icon={<TrendingUpIcon />} value="progress"/>
          <BottomNavigationAction label="Settings" icon={<SettingsIcon />} value="settings"/>
        </BottomNavigation>
        </footer>
        <Switch>
          <Route exact path="/">
            Home
          </Route>
          <Route exact path="/me">
            Me
          </Route>
          <Route exact path="/progress">
            Progress
            blablalba
          </Route>
          <Route exact path="/settings">
            Settings
          </Route>
        </Switch>


      </Router>

    </div>
  );
}

export default App;
